In C, there are several ways to terminate a program. Here are a few common methods:

1. **Return from `main()`**: The simplest way to terminate a C program is to return from the `main()` function. When `main()` returns, the program terminates. You can use the `return` statement with an optional exit status, like this:
```c
int main() {
    // code here
    return 0; // or return EXIT_SUCCESS;
}
```
The `return` statement with a value of 0 or `EXIT_SUCCESS` indicates that the program terminated successfully.

2. **Use `exit()`**: The `exit()` function is a standard library function that terminates the program immediately. You can use it like this:
```c
#include <stdlib.h>

int main() {
    // code here
    exit(0); // or exit(EXIT_SUCCESS);
}
```
The `exit()` function takes an integer argument, which is the exit status of the program.

3. **Use `_Exit()`**: The `_Exit()` function is similar to `exit()`, but it does not perform any additional cleanup or flushing of buffers. It's a more abrupt way to terminate the program.
```c
#include <stdlib.h>

int main() {
    // code here
    _Exit(0); // or _Exit(EXIT_SUCCESS);
}
```
4. **Use `abort()`**: The `abort()` function terminates the program immediately and raises a SIGABRT signal. This is usually used to indicate a fatal error or an unrecoverable situation.
```c
#include <stdlib.h>

int main() {
    // code here
    abort();
}
```
5. **Use a signal**: You can also terminate a program by sending a signal to it using the `raise()` function or the `kill()` system call. For example:
```c
#include <signal.h>

int main() {
    // code here
    raise(SIGINT); // or raise(SIGTERM);
}
```
Note that some of these methods may not perform any cleanup or flushing of buffers, so use them with caution.

Remember to always include the necessary header files and follow the correct syntax when using these methods to terminate your C program.

